  false,\n\t\"url\": null,\n\t\"notes\": \"This report was prepared as one facet of
  the current research project entitled \"Assessment of Impacts to Fish and Wildlife
  from Pesticide Use on the Western Oregon Refuge Complex\". This research project
  was designed to investigate pesticide impacts on aquatic communities on refuge lands.
  The study is scheduled to be completed in 4 phases, including; (1) collection of
  background information, (2) collection and analysis of water samples, (3) performance
  of in-situ fish bioassay, and (4) collection and analysis of blood hormone levels
  in common carp and western pond turtles. This report is a summary of background
  information gathered as the first phase of the research project.\",\n\t\"owner_org\":
